let inp_image= document.getElementById("image")

// on change for selecting the image

inp_image.onchange = () =>{

    handleImage()
}

let image_url;

async function handleImage(){


    let img=document.getElementById("image")

    let actual_img = img.files[0]

    let form = new FormData()

    form.append("image",actual_img)


    let res = await fetch(`https://api.imgbb.com/1/upload?key=72eb1456c15dcf6a3762f5107592b7d5`,{
        method:"POST",
        body: form,//file data not json data
    });

    let data = await res.json();
    image_url=data.data.display_url

    console.log(image_url)

}

